import React from "react";
import {
    Table,
    TableContainer,
    TableBody,
    Paper,
    TableRow,
    TableCell,
} from "@mui/material";

// 모든 유저 검색창(닉네임으로)
// + 로그인 된 유저 목록 (프로필 / 친구 신청 버튼)
function User({loginUser}) {
    console.log('내려받은 로그인 목록', loginUser)
    // 친구 신청
    return (
        <span>
            <TableContainer
                style={{ padding: "20px", height: "100px" }}
                component={Paper}
            >
                <Table size="medium">
                    <TableBody>
                        {loginUser &&
                            loginUser.map((user, index) => (
                                <TableRow key={index}>
                                    <TableCell>
                                        {user.nickname} 
                                    </TableCell>
                                </TableRow>
                            ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </span>
    );
}
export default User;
